script: |
  super -f text -I q1434.sql | sort > q1434.out

inputs:
  - name: q1434.sql
    data: |
      SELECT 20 + col1 AS col0 FROM tab2 AS cor0 WHERE - - 79 NOT BETWEEN NULL AND + - 5 OR NULL IN ( - col0, + col1 * - col2, col1 * col0, + col0, - col0 );
  - name: tab2

outputs:
  - name: q1434.out
    data: |
      71
      87
      97
